style.css:
@-moz-document url-prefix("https://cse.google.com") {
html {
    backgrond-color: black;
}
.gcsc-find-more-on-google {
	color: grey;
}
.gsc-webResult:nth-child(n) {
  background-color: black;
  color: grey;
}
.gsc-webResult:nth-child(n) .gsc-url-top > .gs-visibleUrl-long {
  color: lightgreen;
}
.gsc-webResult:nth-child(n) .gsc-thumbnail-inside > .gs-title > .gs-title {
  color: lightblue;
}
.gsc-webResult:nth-child(n) .gsc-table-cell-snippet-close > .gs-bidi-start-align {
  color: grey;
}
#gsc-i-id1, #gs_tti50 {
  background-color: black;
  color: grey;
}

#gs_cb50, #gsc-iw-id1, .gsc-search-button-v2, #gs_st50{
  color: black;
  background-color: black;
}
.gsc-result:nth-child(n):hover, .gsc-webResult .gsc-cursor-page:nth-child(n) {
  background-color: black;
  }
}
